.: Plot :. 

Looking for love in all the wrong places.

We all know that older men lust after younger women. But sometimes, the young hotties are the instigators! See for yourself as adorable Keisha Grey finds intense passion with her self defense instructor Evan Stone, vivacious Carter Cruise seduces her college professor Alec Knight, sensational Zoey Foxx finds hot sex with her physical therapist Steven St. Croix and seductive Samantha Roan rewards the sheriff Marcus London with some hot nookie! Cameos from adult legends Melissa Monet and Dana Vespoli.

